### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Simple Linear Regression (SLR)**
- **Concepts**:
  - Independent and dependent variables.
  - Non-linear relationships and logarithmic transformations.
  - Degrees of freedom in ANOVA tables.
- **Equations**:
  - SLR model: \( y = \beta_0 + \beta_1 x + \epsilon \)
  - Logarithmic transformation: \( \ln(y) = \beta_0 + \beta_1 \ln(x) + \epsilon \)
  - Degrees of freedom for regression: \( \text{df}_{\text{regression}} = k \) (where \( k \) is the number of predictors)

#### 2. **Multiple Linear Regression (MLR)**
- **Concepts**:
  - Multiple independent variables.
  - Regression statistics: Multiple R, R Square, Adjusted R Square, Standard Error.
  - ANOVA table: Sum of Squares (SS), Degrees of Freedom (df), Mean Squares (MS), F-statistic.
- **Equations**:
  - MLR model: \( y = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n + \epsilon \)
  - Adjusted R Square: \( R^2_{\text{adj}} = 1 - \left( \frac{(1 - R^2)(n - 1)}{n - k - 1} \right) \)
  - F-statistic: \( F = \frac{\text{MS}_{\text{regression}}}{\text{MS}_{\text{residual}}} \)

#### 3. **Logistic Regression**
- **Concepts**:
  - Binary classification (e.g., Married = 1, Not Married = 0).
  - Thresholds for classification.
  - Confusion matrix: True Positives (TP), True Negatives (TN), False Positives (FP), False Negatives (FN).
  - Performance metrics: Accuracy, Precision, Recall.
- **Equations**:
  - Logistic regression model: \( \ln\left(\frac{p}{1 - p}\right) = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n \)
  - Accuracy: \( \text{Accuracy} = \frac{\text{TP} + \text{TN}}{\text{TP} + \text{TN} + \text{FP} + \text{FN}} \)
  - Precision: \( \text{Precision} = \frac{\text{TP}}{\text{TP} + \text{FP}} \)
  - Recall: \( \text{Recall} = \frac{\text{TP}}{\text{TP} + \text{FN}} \)

#### 4. **Demand Response Curve**
- **Concepts**:
  - Price elasticity of demand.
  - Constant elasticity model.
- **Equations**:
  - Constant elasticity model: \( Q = C P^E \)
  - Where \( Q \) is demand, \( P \) is price, \( E \) is elasticity, and \( C \) is a constant.

